import * as React from "react";
import CoachCard from "../../components/cards/coachcard";

export default function Coachess() {
    
      const coaches = [
        {
          name: "Coach 1",
          id: "SFM2301N1",
          contactDate: "Jan 11",
          expirationDate: "Feb 11",
        },
        // Add more coach objects as needed
      ];
      return (
        <>
          <div className="container">
            <h1 className="title">Active Coaches</h1>
            <button className="add-coach-button">Add Coach</button>
            <div className="coaches-list">
              <h2 className="manage-coaches-title">Manage Coaches</h2>
              <div className="coaches-grid">
                {coaches.map((coach, index) => (
                  <CoachCard key={index} coach={coach} />
                ))}
              </div>
              <div className="pagination">
                <button className="previous-button">Previous</button>
                <button className="next-button">Next</button>
              </div>
            </div>
          </div>
          <style jsx>{`
            .container {
              display: flex;
              max-width: 597px;
              flex-direction: column;
              padding: 0 20px;
            }
            .title {
              color: #fecc09;
              letter-spacing: 1.6px;
              width: 100%;
              font: 700 32px Poppins, sans-serif;
            }
            @media (max-width: 991px) {
              .title {
                max-width: 100%;
              }
            }
            .add-coach-button {
              border-radius: 100px;
              box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, 0.25);
              background-color: #fff;
              align-self: start;
              margin-top: 32px;
              color: #fecc09;
              justify-content: center;
              padding: 0 23px;
              font: 700 20px Poppins, sans-serif;
            }
            @media (max-width: 991px) {
              .add-coach-button {
                padding: 0 20px;
              }
            }
            .coaches-list {
              border-radius: 20px;
              box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, 0.25);
              background-color: #939393;
              display: flex;
              margin-top: 20px;
              width: 100%;
              flex-direction: column;
              padding: 24px;
            }
            @media (max-width: 991px) {
              .coaches-list {
                max-width: 100%;
                padding: 0 20px;
              }
            }
            .manage-coaches-title {
              color: #fffadf;
              font: 700 20px Poppins, sans-serif;
            }
            .coaches-grid {
              gap: 20px;
              display: flex;
            }
            @media (max-width: 991px) {
              .coaches-grid {
                flex-direction: column;
                align-items: stretch;
                gap: 0px;
              }
            }
            .coach-card {
              display: flex;
              gap: 20px;
              justify-content: space-between;
              margin-top: 2px;
            }
            @media (max-width: 991px) {
              .coach-card {
                margin-top: 40px;
                flex-direction: column;
              }
            }
            .coach-info {
              display: flex;
              flex-direction: column;
            }
            .coach-name-wrapper {
              display: flex;
              margin-top: 19px;
              gap: 7px;
            }
            .coach-name {
              color: #fff;
              font-family: Poppins, sans-serif;
              font-weight: 400;
              margin-top: 35px;
            }
            .coach-id-wrapper {
              display: flex;
              align-self: start;
              margin-top: 8px;
              font-size: 14px;
              color: #fffadf;
            }
            .coach-icon {
              aspect-ratio: 1.1;
              object-fit: auto;
              object-position: center;
              width: 11px;
              fill: #fff;
              align-self: start;
            }
            .coach-id {
              font-family: Poppins, sans-serif;
              margin-top: -5px;
              font-weight: 700;
            }
            .coach-contact {
              align-self: end;
              display: flex;
              margin-top: 96px;
              flex-direction: column;
              font-size: 14px;
            }
            @media (max-width: 991px) {
              .coach-contact {
                margin-top: 40px;
              }
            }
            .contact-label {
              color: #fffadf;
              font-family: Poppins, sans-serif;
              font-weight: 700;
            }
            .contact-date {
              color: #fff;
              font-family: Poppins, sans-serif;
              font-weight: 400;
              margin-top: 31px;
            }
            .coach-actions {
              display: flex;
              flex-direction: column;
              line-height: normal;
              width: 40%;
              margin-left: 20px;
            }
            @media (max-width: 991px) {
              .coach-actions {
                width: 100%;
                margin-left: 0;
              }
            }
            .search-wrapper {
              display: flex;
              gap: 12px;
              font-size: 16px;
              color: #fff;
              font-weight: 400;
              text-align: center;
              padding: 0 1px;
              margin-top: 39px;
            }
            @media (max-width: 991px) {
              .search-wrapper {
                margin-top: 40px;
              }
            }
            .search-label {
              font-family: Poppins, sans-serif;
              align-items: start;
              border-radius: 12px;
              background-color: #3e3e3e;
              justify-content: center;
              padding: 3px 21px;
            }
            @media (max-width: 991px) {
              .search-label {
                padding: 0 20px;
              }
            }
            .search-icon {
              aspect-ratio: 0.93;
              object-fit: auto;
              object-position: center;
              width: 24px;
              fill: #fff;
              align-self: start;
            }
            .expiration-wrapper {
              display: flex;
              margin-top: 25px;
              gap: 20px;
              justify-content: space-between;
            }
            .expiration-label {
              color: #fffadf;
              font-family: Poppins, sans-serif;
              font-weight: 700;
              margin-top: 2px;
              font-size: 14px;
              align-self: start;
            }
            .expiration-date {
              color: #fff;
              font-family: Poppins, sans-serif;
              font-weight: 400;
              align-self: start;
              margin: 26px 0 0 17px;
              font-size: 14px;
            }
            @media (max-width: 991px) {
              .expiration-date {
                margin-left: 10px;
              }
            }
            .edit-wrapper {
              display: flex;
              flex-direction: column;
              margin-top: 25px;
            }
            .actions-label {
              color: #fffadf;
              margin-top: 2px;
              font: 700 14px Poppins, sans-serif;
            }
            .edit-button {
              justify-content: center;
              border-radius: 10px;
              background-color: #fff;
              align-self: start;
              color: #3e3e3e;
              text-align: center;
              margin: 26px 0 0 12px;
              padding: 3px 10px;
              font: 400 10px Poppins, sans-serif;
            }
            @media (max-width: 991px) {
              .edit-button {
                margin-left: 10px;
              }
            }
            .pagination {
              align-self: end;
              display: flex;
              margin-top: 135px;
              gap: 5px;
              font-size: 14px;
              color: #fff;
              font-weight: 400;
              text-align: center;
            }
            @media (max-width: 991px) {
              .pagination {
                margin-top: 40px;
              }
            }
            .previous-button {
              font-family: Poppins, sans-serif;
              justify-content: center;
              border-radius: 10px;
              background-color: #3e3e3e;
              padding: 3px 15px;
            }
            .next-button {
              font-family: Poppins, sans-serif;
              justify-content: center;
              border-radius: 10px;
              background-color: #3e3e3e;
              padding: 3px 17px;
            }
          `}</style>
        </>
      );
    }
